import React from "react";
import Hero from "./Hero";
import AboutMe from "./AboutMe";
import Skills from "./Skills";
import ContactMe from "./ContactMe";

const Container = () => {    
    return (
        <div className="container-fluid">
            <Hero />
            <AboutMe />
            <Skills />
        </div>
    );
}

export default Container;
